import React from 'react';
import Node from '../image/my1.jpg';
//import { NavLink } from 'react-router-dom';

import LinkPage from '../components/LinkPage';


function About() {
    return (
        <div className='about'>
          <LinkPage 
           name='&nbsp;&nbsp;' 
           imgsrc={Node} 
           visit= '/contact' 
           btname='Contact Now' />
        </div>
    );

};

export default About;
